/*Table structure for table `nomina` */

DROP TABLE IF EXISTS `nomina`;

CREATE TABLE `nomina` (
  `idnomina` int(11) NOT NULL AUTO_INCREMENT,
  `idnominaemp` int(11) DEFAULT NULL COMMENT 'id de la nomina de empleados(nominaemp)',
  `concepto` varchar(5) DEFAULT NULL COMMENT 'id de la percepcion o de la deduccion',
  `importe` decimal(10,2) DEFAULT NULL COMMENT 'importe percibido o deducido',
  `tipo` char(1) DEFAULT NULL COMMENT 'percepcion o deduccion (P ó D)  segun sea el caso',
  `idbeneficiarios` int(11) DEFAULT '0',
  PRIMARY KEY (`idnomina`)
) ENGINE=InnoDB AUTO_INCREMENT=4 DEFAULT CHARSET=latin1;

