/*Table structure for table `nominabaja` */

DROP TABLE IF EXISTS `nominabaja`;

CREATE TABLE `nominabaja` (
  `idnominabaja` int(11) NOT NULL AUTO_INCREMENT,
  `idnominapago` int(11) NOT NULL DEFAULT '0',
  `idnominaemp` int(11) DEFAULT NULL,
  `cve_concepto` varchar(5) DEFAULT NULL,
  `importe` decimal(10,2) DEFAULT '0.00',
  `tipo` varchar(1) DEFAULT NULL,
  `quincena` int(11) DEFAULT NULL,
  `anio` char(4) DEFAULT NULL,
  `fechaemision` date DEFAULT NULL,
  `fechasistema` datetime DEFAULT NULL,
  `usuario` int(11) DEFAULT NULL,
  `cve_sat` varchar(5) DEFAULT NULL,
  `idarea` int(11) DEFAULT NULL,
  PRIMARY KEY (`idnominabaja`)
) ENGINE=InnoDB DEFAULT CHARSET=latin1;

/*Data for the table `nominabaja` */

/*Table structure for table `nominaemp` */

DROP TABLE IF EXISTS `nominaemp`;

CREATE TABLE `nominaemp` (
  `idnominaemp` int(10) NOT NULL AUTO_INCREMENT,
  `paterno` varchar(55) DEFAULT NULL,
  `materno` varchar(55) DEFAULT NULL,
  `nombres` varchar(55) DEFAULT NULL,
  `calle` varchar(70) DEFAULT NULL,
  `numint` varchar(7) DEFAULT NULL,
  `numext` varchar(7) DEFAULT NULL,
  `colonia` varchar(70) DEFAULT NULL,
  `cp` varchar(5) DEFAULT NULL,
  `ciudad` varchar(70) DEFAULT NULL,
  `estado` varchar(70) DEFAULT NULL,
  `rfc_iniciales` varchar(4) DEFAULT NULL,
  `rfc_fechanac` varchar(6) DEFAULT NULL,
  `rfc_homoclave` varchar(3) DEFAULT NULL,
  `curp` varchar(22) DEFAULT NULL,
  `fechaingr` date DEFAULT NULL COMMENT 'fecha en la que ingreso a trabajar por primera vez',
  `nafiliacion` varchar(20) DEFAULT NULL COMMENT 'número de afiliacion al IMSS',
  `salariofv` char(1) DEFAULT 'F' COMMENT 'Salario Fijo o Variable, por defecto se pone Fijo',
  `contrato` varchar(20) DEFAULT NULL COMMENT 'Tipo de contrato: permanente, asimilado, eventual, por defecto se pone eventual.',
  `estatus` int(11) DEFAULT NULL,
  `nomina` char(1) DEFAULT 'Q' COMMENT 'tipo de nomina: quincenal o semanal, por defecto se pone quincenal',
  `jornada` char(1) DEFAULT '5' COMMENT 'tipo de jornada laboral, puede ser de 5 o 6 dias a la semana, por defecto se pone de 5 dias.',
  `de_hrs` varchar(2) DEFAULT NULL,
  `de_min` varchar(2) DEFAULT NULL,
  `a_hrs` varchar(2) DEFAULT NULL,
  `a_min` varchar(2) DEFAULT NULL,
  `formapago` char(2) DEFAULT 'DE' COMMENT 'la forma de pago para el empleado: deposito o cheque, por defecto se pone por deposito.',
  `ncuenta` varchar(30) DEFAULT NULL COMMENT 'numero de cuenta bancaria en caso de que sea por deposito.',
  `fechainicio` date DEFAULT NULL COMMENT 'Fecha de renovacion de contrato',
  `fechabaja` date DEFAULT NULL,
  `fechasistema` datetime DEFAULT NULL,
  `usuario` varchar(45) DEFAULT NULL,
  `clabe` varchar(45) DEFAULT NULL,
  `idbancos` int(11) DEFAULT NULL,
  `fechanacimiento` date DEFAULT NULL,
  `sexo` char(1) DEFAULT NULL,
  `ecivil` char(2) DEFAULT NULL,
  `escolaridad` varchar(45) DEFAULT NULL,
  `nafiliacionissste` varchar(45) DEFAULT NULL,
  `oficinadepago` varchar(5) DEFAULT NULL,
  `cartillaSMN` varchar(45) DEFAULT NULL,
  `nacionalidad` varchar(45) DEFAULT NULL,
  `folio` varchar(45) DEFAULT NULL,
  `sueldobase` decimal(10,2) DEFAULT NULL,
  `zona` char(2) DEFAULT NULL,
  `sindicato` char(1) DEFAULT NULL,
  `activo` int(11) DEFAULT NULL,
  PRIMARY KEY (`idnominaemp`),
  KEY `nombre` (`paterno`,`materno`,`nombres`),
  KEY `curp` (`curp`)
